import React, { useEffect } from "react";
import PropTypes from "prop-types";

const GithubRepo = (props) => {
  useEffect(() => {
    props?.getGithubRepo({
      github_usr_name: props?.profile?.profile?.githubUserName,
    });
  }, []);
  return (
    <div class="profile-github">
      <h2 class="text-primary my-1">
        <i class="fab fa-github"></i> Github Repos
      </h2>

      {props?.profile?.repos?.length > 0 ? (
        <p>No Github Repo Found</p>
      ) : (
        <div class="repo bg-white p-1 my-1">
          <div>
            <h4>
              <a href="#" target="_blank" rel="noopener noreferrer">
                Repo One
              </a>
            </h4>
            <p>
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Repellat,
              laborum!
            </p>
          </div>
          <div>
            <ul>
              <li class="badge badge-primary">Stars: 44</li>
              <li class="badge badge-dark">Watchers: 21</li>
              <li class="badge badge-light">Forks: 25</li>
            </ul>
          </div>
        </div>
      )}
    </div>
  );
};

GithubRepo.propTypes = {};

export default GithubRepo;
